import "./Error.css";
import { NavLink } from 'react-router-dom';
import ErrorPic from '../assets/ErrorPic.png';
import Button from '@mui/material/Button';

// var sectionStyle ={
//     width: "100%",
//     height: "400px",
//     backgroundImage: "url(" + { ErrorPic } + ")"
// };

const Error = () => {
    return (<div>
            <div>
                <div style={{ backgroundImage: `url(${ErrorPic})`,
                          backgroundAttachment: 'fixed',
                          backgroundRepeat: 'no-repeat',
                backgroundSize:'cover',

                width: '100%', 
                height: '800px',
                display:'flex',
                justifyContent:'center',
                alignItems:'start' }}>
                    < ><Button color ='primary' component = {NavLink} to = '/' variant ="contained" style = {{textTransform:'none', marginTop:'20rem', textDecoration:'none'}} disableRipple>Go Home</Button></>
                </div>
            </div>
            </div>);
}
export default Error;
